export default class RowContainer extends Component {
  constructor(props) {
    super(props);
    this.myRef = React.createRef();
  }
  render() {
    return (
      <div className="RowContainer">
        <div ref={this.myRef} className="RowContainer__item">
          {" "}
          {this.props.children}
        </div>
      </div>
    );
  }
}
